const MapElementsConfig = {
    getIcon: function (icon) {
        return 'map/icons/' + icon + '';
    },

    checkIfImageExists: function (imageSrc, callback) {
        var img = new Image();
        img.onload = function () {
            callback(true);
        };
        img.onerror = function () {
            callback(false);
        };
        img.src = imageSrc;
    },
};

